import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";

const FooterComponent = () => {
  return (
    <Container className="w-100 h-25 pt-5 mx-auto">
      <Row xs={4} md={4} lg={4}>
        <Col>
          <Link to="/myaccount">Account</Link>
        </Col>
        <Col>
          <Link>Location</Link>
        </Col>
        <Col>
          <Link>Policy</Link>
        </Col>
        <Col>
          <Link>Account</Link>
        </Col>
      </Row>
      <Row>
        <Col>
          <p className="text-muted fw-light p-5 text-center">
            SALA Investment Co. Company
          </p>
        </Col>
      </Row>
    </Container>
  );
};

export default FooterComponent;
